import React, { Component } from 'react';
import Project from './Project/Project';

class Projects extends Component {
    constructor() {
        super();
        this.state = {
            data: {
                heads : ["Burger Builder","Facial Recognition","Loan Prediction"],
                descriptions: ["Burger Builder content","Facial Recognition content","Loan Prediction content"]
            },

            data2: [{
                head: "Burger Builder",
                description: "Burger Builder content"
            },{
                head: "Facial Recognition",
                description: "Facial Recognition content"
            },{
                head: "Loan Prediction",
                description: "Loan Prediction content"
            }]
        };
         
    }   
  
    render() {
        return (
        <div>
            <Project props={this.state.data} />
        </div>
        );
    }
}
export default Projects;
